import React from "react"
import './HomePage.css'
import { StylesProvider } from "@material-ui/core"

class HomePage extends React.Component {

    routeChange=(page)=> {
        window.location.href=page
    } 

    render() {
        return (
            <div>
                <h1 className = 'titleHeader'>Welcome to TigerPhotos!</h1>
                <div className="buttons">
                    <button className="fbutton"onClick={() => this.routeChange("browse")}>Browse Photographers</button>
                    <button className="fbutton"onClick={() => this.routeChange("create")}>Create your Profile</button>
                </div>
            </div>
        )
    }
}

export default HomePage
